import React from 'react'

function Footer() {
    return(
    <footer class="my-5 text-muted text-center text-small">
    <div class="container">
            <a href="#">Back to top</a>
            <p class="mb-1">&copy; 2019 Second Time Around</p>
    </div>
</footer>
    );
}

export default Footer;
